import React from "react";

export const TileList = ({ objectList }) => {

  const tilesToRender = objectList.map((obj) => (
  <div>{Object.keys(obj).map(key => (
    <h2>{key}: {obj.key}</h2>
    ))}
  </div>
  ));

  return (
    <div>
      {tilesToRender}
    </div>
  );
};
